import { Link } from "react-router-dom";

function HomePage()
{
    return (
        <>
        <main>
        <h1>My home page</h1>
        <p>
            Go to <Link to="/products">the list of products</Link>
        </p>

        </main>
        
        </>
    );
}

export default HomePage;
